}","keccak256":"0x18228999bc807214d21d1bb1f7d428a5084e14331921423d267dd9e5a0aad5da","license":"GPL-3.0"},"contracts/Uniswap/interfaces/IUniswapV2Factory.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
